import React, { useEffect, useState } from 'react';
import useInputBar, {} from '@components/molecules/InputBar';
import DarkButton from '@components/molecules/DarkButton';
import useDarkButtonExpand from '@components/molecules/DarkButtonExpand';
import SongCard from '@components/molecules/SongCard';
import * as Styled from './styles';
import {Props, TrackInfoType} from './types';
import { rootCertificates } from 'tls';
import Router from 'next/router';
import { ENDPOINTS, createDBEndpoint } from '../../../api/endpoint';
// import { useWhatChanged } from '@simbathesailor/use-what-changed';

const Library: React.FC<Props> = ({playlistId}) => {
  const [songsCollection, setSongs]=useState(
    [
        {
        id:0,
        trackName:'',
        band:'',
        genre:''
        }
      ]
  );

  const headSort = 'Sort by';
  const listSort = [
    { title: 'By Title', value: 'TrackName' },
    { title: 'By Band', value: 'Band' },
    { title: 'By Genre', value: 'Genre' }];
  const {
    pickedItem: pickedCategory,
    renederDBtnExp: renderCategoryBtn,
  } = useDarkButtonExpand(listSort, headSort);
  const { renderInputBar, barInput } = useInputBar({ type: 'search' });

  const defaultImageDataURL='data:image/jpeg;base64,';
  const handleEditClick = () => {
    // console.log('edit');
  };
  const handleSongClicked = (id: number) => {
    Router.push(`/library/song/${id}`);
  };
  useEffect(() => {
    console.log(pickedCategory);
    console.log(barInput);
    const pagingInfo={
      TrackNameFilterValue:barInput,
      SortInfo:{
          key:pickedCategory,
          value:'asc'
      }
    };
    //createDBEndpoint(ENDPOINTS.library.getPlaylist+playlistId)
    createDBEndpoint(ENDPOINTS.library.getPlaylist+7)
    .post(pagingInfo)
    .then((res)=>{
      const tmpSongs:TrackInfoType[]=res.data.trackInfos;
      setSongs(tmpSongs);
    });
  }, [pickedCategory, barInput]);
  return (
    <Styled.Wrapper>
      <Styled.Content>
        <Styled.ToolBox>
          <Styled.UpRow>{renderInputBar}</Styled.UpRow>
          <Styled.DownRow>
            <Styled.DownRowSide>
              {renderCategoryBtn}
            </Styled.DownRowSide>
            <Styled.DownRowSide>
              <button
                type="button"
                style={{ backgroundColor: 'transparent', border: 'unset' }}
                onClick={handleEditClick}
              >
                <DarkButton text="Edit" />
              </button>
            </Styled.DownRowSide>
          </Styled.DownRow>
        </Styled.ToolBox>
        <Styled.List>
          {songsCollection.map((i) => (
            <div
              key={i.id}
              onClick={() => handleSongClicked(i.id)}
            >
              <SongCard
                name={i.trackName}
                band={i.band}
                genre={i.genre}
                imagePath={defaultImageDataURL}
              />
            </div>
          ))}
        </Styled.List>
      </Styled.Content>
    </Styled.Wrapper>
  );
};

export default Library;
